$data_ = json_decode(file_get_contents("php://input"), true);

$method = $_SERVER["REQUEST_METHOD"];

$response = [];
$code = 200;
$error = false;
$message = 'Exec with no actions';
$data = [];
$object = [];

if($method !== "POST") {
    // http_response_code(400);
    // echo json_encode(array("response" => "Bad Method"));
    [$code, $error, $message] = [400, true, 'Bad Method, try another time'];
}
else if (!isset($data_["api_key"])) {
    // http_response_code(400);
    // echo json_encode(array("response" => "Bad Request"));
    [$code, $error, $message, $data] = [403, true, 'Bad Request, try another time', $data_];
} 
else if (md5(date("d-m-Y")) !== $data_["api_key"]) {
    // http_response_code(401);
    // echo json_encode(array("response" => "Unauthorized"));
    [$code, $error, $message] = [401, true, 'Unauthorized, try another time', $data_];
} 
else {
    // http_response_code(200);
    // echo json_encode(array("response" => datos()));
    [$code, $error, $message, $data, $object] = [200, false, 'Good response', $data_, datos()];
}

// $response = [$code, $error, $message, $data, $object];
$response['code'] = $code;
$response['error'] = $error;
$response['message'] = $message;
$response['data'] = $data;
$response['object'] = $object;
http_response_code( $response['code'] );
echo json_encode( $response );
exit();